        "Desc": "Материал повышения таланта.<br>Поэзия - это душа царства ветров.<br>Поэзия - это проявление желания воодушевлять. Тёмным летним днём злой ветер на улицах и в переулках шепчет слова ярости, словно бой военных барабанов, словно грохот бури.",
