        "R": 3,
        "Name": "Указания о «Процветании»",
        "Desc": "Материал повышения таланта.<br>Процветание - это стремление царства земли.<br>Процветание - это обещание Ли Юэ перед своими детьми вознаградить усердие рабочих достаточным количеством золота для того, чтобы украсить эти земли.",
