        "R": 4,
        "Name": "Ложный плавник Дракона глубин",
        "Desc": "Кусок биологической ткани, который вы нашли после победы над вишапом глубин.<br>Хотя он выглядит как плавник, на самом деле он таковым не является.<br>Жители Бякуякоку хорошо изучили вишапов глубин. Их самой главной отличительной особенностью была способность выбирать, какие черты передавать своему потомству. Из-за своей огромной ненависти к человечеству эти вишапы теряют остроту зрения к моменту достижения зрелого возраста. В то же время они развили определённую степень элементального полиморфизма в боевых целях.",
