        "R": 4,
        "Name": "Гарпастум ветра",
        "Desc": "Гарпастум, изготовленный из чистых перьев и крепкой ткани. Является важнейшим элементом традиционного мондштадтского праздника Луди Гарпастум.<br>Птицы - существа, которые парят с ветром, и их перья несут «благословения ветров». Поэтому мондштадтцы верят, что гарпастумы не только несут благословение Барбатоса, но и обладают чудесными силами.",
